import React, { Component } from 'react';


class Header extends Component {

  render() {
    return (<header>
      <div className="header">
        <div className="header_Inner">
        <div className="header_logo">{this.props.title}</div>
        <div className="header_button" >
          <a className="header_button-list header_button-select cho">応援する</a>
          <a href="/support" className="header_button-list cho choice">支援中</a>
          <a href="/Setting" className="header_button-list choice">支援してもらう</a>
        </div>
        <div className="header_login">
          <a href="/login" id="" title="ログイン" className="login">ログイン</a>
        </div>
        </div>
     </div>
      <div>{this.props.header}</div>


    </header>);
  }
}
export default Header;
